-- Alter employees table to enable longer inputs

alter table employees alter column first_name type varchar(20) using first_name::varchar(20);

alter table employees alter column title type varchar(40) using title::varchar(40);

alter table employees alter column city type varchar(50) using city::varchar(50);

alter table employees alter column region type varchar(20) using region::varchar(20);

alter table employees alter column postal_code type varchar(20) using postal_code::varchar(20);

alter table employees alter column country type varchar(20) using country::varchar(20);

